import React from "react";
import { Button, Form } from "react-bulma-components";

function BookForm() {
  return (
    <>
      <Form></Form>
      <Button.Group>
        <Button
          fullwidth
          rounded
          color="primary"
          onClick={() => console.log("ok")}
        >
          Login
        </Button>
      </Button.Group>
    </>
  );
}

export default BookForm;
